var $bm_rt;
var temp;
temp = thisComp.layer('CONTROL').effect('SIZE')('Slider');
$bm_rt = [
    temp,
    temp
];

var $bm_rt;
var delay, myDelay, t, freq, amplitude, decay, s;
delay = 0.05;
myDelay = $bm_mul(delay, textIndex);
$bm_rt = t = $bm_sub($bm_sub(time, inPoint), myDelay);
if (t >= 0) {
    freq = 1;
    amplitude = 100;
    decay = 8;
    s = $bm_div($bm_mul(amplitude, Math.cos($bm_mul($bm_mul($bm_mul(freq, t), 2), Math.PI))), Math.exp($bm_mul(decay, t)));
    $bm_rt = [
        s,
        s
    ];
} else {
    $bm_rt = value;
}
